import styled from 'styled-components';

export const Container=styled.div`
    max-width: 1200px;
    margin: 0 auto;
`;
 export const Heading=styled.p`
  font-family: 'BerkeleyStd';
  margin: 0px;
  font-size: 42px;
  line-height: 1.14;
  letter-spacing: 0.5px;
  color: #022737;
  padding-bottom: 10px;
 `;
 export const Accountname=styled.p`
  font-family: BerkeleyStd;
  margin: 0px;
  font-weight: bold;
  font-size: 16px;
  line-height: 1.5;
  color: #022737;
 `;
 export const BalanceDate=styled.p`
 padding-bottom: 20px;
 /* margin-bottom: 20px; */
  font-family: HelveticaNeue;
  margin: 0px;
  font-size: 16px;
  line-height: 1.5;
  color: #505050;
 `;
export const Notice=styled.div`
    background-color: #f2f2f2;
    padding: 15px;
    border-radius: 0px;
    border-left: 4px solid #e37222 !important;
    border: none;
    margin-bottom: 35px;
`;
export const Content=styled.span`
    padding-left: 10px;
    font-family: HelveticaNeue;
`;

export const WidthWrapper=styled.div`
    background-color: #eaeaea;   
`;
export const Dashboard=styled(Container)`
     padding: 35px 0px; 
`;

export const ActivityContainer=styled.div`
    display: flex;
    flex-direction: row;
`;
export const AlignmentLeft=styled.div`
    flex-basis: 30%;
`;
export const AlignmentRight=styled.div`
    flex-basis: 70%;
    margin-left: 30px;
    box-shadow: 0 9px 21px 0 rgba(128, 152, 213, 0.08);
    border: solid 1px #eaeaea;
    background-color: #ffffff;
    margin-bottom: 30px;
    /* background-color: white; */
`;
export const ButtonAlignment=styled.div`
    display: flex;
    justify-content: space-between;
    margin-bottom: 30px;
`;
export const Dropdown=styled.select`
  font-family: HelveticaNeue;
  font-size: 16px;
  font-weight: bold;
  font-stretch: condensed;
  letter-spacing: 0.5px;
  color: #006778;
  border: solid 1px #d4d4d4;
  background-color: #ffffff;
`;
export const ButtonWrapper=styled(ButtonAlignment)`
    margin-bottom: none;
    margin: 30px 0px;
`;

export const AccountActivityText=styled.p`

`;

export const BalanceOverTimeText=styled.p`

`;

export const GraphText=styled.p`

`;

export const GraphWithPortfolio=styled.div`
    display: flex;
`;

export const PortfolioWrapper=styled.div`
    flex-basis: 50%;
`;

export const DonutGraphWrapper=styled.div`

`;
